import React from 'react';
import HeaderWithSidebar from '../Sidebar';

function Achievements() {
  return (
    <div>
      <HeaderWithSidebar />
      <div className="content">
        <h1>Achievements</h1>
        <p>View your achievements and milestones here.</p>
      </div>
    </div>
  );
}

export default Achievements;
